import { StyleSheet, Text, View, Pressable } from "react-native";
import { Card } from "../Card";
import React from "react";

export const Category = ({ item }) => {
  return (
    <Pressable>
      {console.log(item)}
      <Card>
        <Text style={styles.categoryText}>{item}</Text>
      </Card>
    </Pressable>
  );
};

const styles = StyleSheet.create({
  categoryText: {
    fontSize: 15,
    color: "black",
  },
});
